text = {
	["Default"] = { name = "-", desc = "Verfkit zonder naam" },
	["so_yellow"] = { name = "Bulldozer", desc = "Het heeft afzonderlijk gespoten effen kleuren onderdelen in een productielijn geel kleurenschema.\n\nDeze botbreker is een verwoester." },
