	["aa_vertigo"] = { name = "Hypnotic", desc = "Het is gespoten met een parelbasislaag en vervolgens met een grafisch patroon door een stencil heen zwart gespoten.\n\nJe bent niet slaperig, je verliest je bewustzijn door bloedverlies" },
