	["am_carbon_fiber"] = { name = "Carbon Fiber", desc = "Het is gespoten met een koolstofvezel-hydrografie over een grafieten basis.\n\nHet is niet omdat ik mijn team gedragen heb dat het geen teamprestatie is - Rona Sabri, rijzende ster" },
