	["cu_pinstripe_ak47"] = { name = "Emerald Pinstripe", desc = "Het heeft een moeras-eiken kolf gekregen en is geschilderd in witte en groene krijtstrepen.\n\nAls je aan Imogan twijfelt, twijfel je aan mij. Laten we nu eens rustig aan doen, wat Schotse whisky drinken en ter zake komen - De vader en de feniks, deel 2" },
