	["cu_skull_nova"] = { name = "Rising Skull", desc = "Het is gepersonaliseerd met een afbeelding van een schedel, gebruikmakend van matte verfsoorten en een op olie gebaseerde markeerverf.\n\nMr. Izaki, ik klaag niet... maar hoeveel shotguns hebt u nodig? - Imogen and The Oni, deel 1" },
