	["aq_obsidian"] = { name = "Magma", desc = "Het heeft verkoperde onderdelen die zijn gemaskeerd in een magmapatroon en een rode patina die eraan zijn gegeven met gebruik van natriumchloride en hoog vuur. Ontmaskerde gebieden zijn vervolgens verduisterd via oxidatie met behulp van lever van zwavel.\n\nEen brandende vuurkoers" },
