	["am_metal_inlay"] = { name = "Dark Age", desc = "Het is geschilderd met metalen verf om te lijken alsof het is ingelegd met metalen in een middeleeuws motief.\n\nIk kan haar minnaar doden... misschien heb je daardoor nog wat tijd met Valeria over - De liefde van een vader, deel 2" },
	["hy_vines"] = { name = "Briar", desc = "Het is beschilderd met een hydroprint van krullende wijnstokken en bloemen.\n\nEen kus van de ware liefde kan je niet van zijn weerhaken redden" },
	["so_indigo"] = { name = "Royal Blue", desc = "Het is geschilderd in effen kleuren van indigo, purper en grijs.\n\nLach eens, Felix. Je zult meer geluk bij de vrouwtjes hebben als je er niet altijd als een stugge vent uitziet - Imogen, wapenhandelaar in opleiding" },
	["so_indigo_and_grey"] = { name = "Indigo", desc = "Het is geschilderd in effen kleuren van indigo, blauw en grijs.\n\nAlex Kincaide, ik weet zeker dat je vol vragen zit... laat mij je de antwoorden geven - De feniks en de verhalenverteller, deel 1" },
	["cu_well_traveled_ak47"] = { name = "Jet Set", desc = "De kolf is in bruin leer gewikkeld. Dit wapen is naar vele steden geweest.\n\nIedereen die oplet kan de verbanden leggen en zien wat ze heeft gedaan. We hebben niet veel tijd over om een oplossing te vinden... - De liefde van een vader, deel 1" },
