	["cu_leather_xm1014"] = { name = "Red Leather", desc = "Zijn kolf en handgreep zijn in rood leer gewikkeld.\n\nPak je koffers. Laten we die hufter doden... - De oni en de walkure, deel 2" },
	["cu_luggage_sg553"] = { name = "Traveler", desc = "Het is speciaal beschilderd in een gestreept ontwerp dat is geïnspireerd door vintage bagage en heeft een aantal in bruin leer verpakte onderdelen.\n\nIedereen heeft een verhaal en Javier zal die van jou uit je halen voordat hij je doodt" },
	["cu_luggage_usp-s"] = { name = "Business Class", desc = "Het is speciaal beschilderd in een gestreept ontwerp dat is geïnspireerd door vintage bagage en heeft een aantal in bruin leer verpakte onderdelen.\n\nSommige mensen willen gewoon geen extra beenruimte... ze willen vrede en stilte" },
	["hy_plaid1"] = { name = "Olive Plaid", desc = "Het is beschilderd met een hydroprint van een beige en olijfgroen geruit patroon.\n\nIk vind het leuk. Het benadrukt mijn ogen voor de camera... - Rona Sabri, aankomende ster" },
