	["cu_negev_impact"] = { name = "Power Loader", desc = "Het is speciaal beschilderd met een hydroprint die doet denken aan zware machines.\n\nGevreesd door koninginnen. Geliefd door bisschoppen." },
	["am_p2000_imperial_red"] = { name = "Imperial", desc = "Het is geëtst met een laser en beschilderd met rode en gele metallic verf.\n\nMijn gevoelens zijn irrelevant, Keo, ik moet een imperium beschermen - Booth, wapenhandelaar" },
	["cu_p90_shapewood"] = { name = "Shapewood", desc = "De houten klof is met de hand gesneden, geschuurd en gelamineerd.\n\nPincet niet inbegrepen" },
	["gs_sawedoff_necromancer"] = { name = "Yorick", desc = "Het heeft een hydroprint van een schedel en met de hand geschilderde gouden accenten gekregen.\n\nRosencrantz en Guildenstern maakten geen enkele kans..." },
	["hy_scar20_jungler"] = { name = "Outbreak", desc = "Het is beschilderd met levendige groene tinten.\n\nValeria wordt brutaler... het is tijd om de strijd met haar aan te gaan - Felix Riley, commandant" },
	["gs_sg553_tiger_moth"] = { name = "Tiger Moth", desc = "Het is speciaal beschilderd met het patroon van de vleugel van een mot.\n\nValeria wordt steeds brutaler... de tijd is aangebroken om met haar de strijd aan te gaan - Felix Riley, Commandant" },
	["cu_tec9_avalanche"] = { name = "Avalanche", desc = "Het is speciaal beschilderd met een gestroomlijnde en futuristische hydroprint.\n\nWe moeten slim zijn in hoe we tegen haar ingaan; één verkeerde beweging en ze zal ons beide vermorzelen - De slang en de waarheidszoeker" },
	["aq_xm1014_hot_rod"] = { name = "Teclu Burner", desc = "Er is metallic verf gebruikt om vlammen toe te voegen.\n\nSoms is een bunsenbrander niet genoeg..." },
	["gs_ak47_supercharged"] = { name = "Fuel Injector", desc = "Het lichaam van het geweer is helder geel geschilderd en het magazijn is op maat geschilderd om er als machinerie uit te zien.\n\nLeef je leven per kwart magazijn" },
	["cu_bizon_citizen"] = { name = "Photic Zone", desc = "Het heeft een op maat geschilderd camouflagepatroon gekregen dat is geaccentueerd met fluorescerende verf.\n\nJe hoort geen brekende golven..." },
	["aq_deserteagle_kumichodragon"] = { name = "Kumicho Dragon", desc = "Er zijn met een laser draken in de sleep en greep geëtst.\n\nIk ben een groot fan van je werk, Yukako. We moeten praten... -Huxley, de competitie" },
	["cu_fiveseven_augmented"] = { name = "Triumvirate", desc = "Het heeft een lichtblauwe DDPAT-hydroprint en een op maat geschilderde slede gekregen.\n\nIk verdien niet aan oorlog, ik verdien aan de menselijke omstandigheden... - Booth, wapenhandelaar" },
