	["gs_m4a4_pioneer"] = { name = "The Battlestar", desc = "Alle hoeken zijn van het aankoopbewijs afgeknipt.\n\nPas op voor diegenen die over de wachttoren spreken" },
	["am_mac10_electricity"] = { name = "Lapis Gator", desc = "Het heeft een hydroprint gekregen van een heldere krokodillenhuid.\n\nExclusief moerasboot" },
