	["cu_ssg08_necropos"] = { name = "Necropos", desc = "Het is met de hand beschilderd met slechte runen.\n\nElke timmerman heeft zijn hamer nodig en elke kleermaker zijn spil..." },
	["gs_tec9_jambiya"] = { name = "Jambiya", desc = "Het is met de hand beschilderd en met lasers geëtst met Midden-Oosterse patronen.\n\nShahrazad vertelde 1000 verhalen... dit is de laatste die je zult horen" },
	["gs_usp_voltage"] = { name = "Lead Conduit", desc = "Het heeft een op maat geschilderde gegraveerde demper en slede gekregen.\n\nJe hebt wat je wilde, weet je wat dat betekent? – Booth, wapenhandelaar" },
	["cu_aug_swallows"] = { name = "Fleet Flock", desc = "Het heeft een hydroprint gekregen van vogels die door de wolken vliegen.\n\nSommige vogels staan voor harmonie en vrede... dit zijn niet die vogels" },
	["cu_bizon_Curse"] = { name = "Judgement of Anubis", desc = "Het is speciaal beschilderd in een Egyptisch thema.\n\nDe trekker weegt minder dan een veertje" },
	["gs_cz75a_redastor"] = { name = "Red Astor", desc = "Het is met de hand beschilderd met rode en witte accenten.\n\nBooth staat nu gelijk aan familiedrama; en wie heeft er nu tijd voor drama als we zaken bespreken - Huxley, The Competition" },
