	["gs_galilar_incenerator"] = { name = "Firefight", desc = "Het heeft rode accenten en een met de hand beschilderd pictogram gekregen.\n\nBooth had dit wapen opgedragen aan Valeria in een poging zaken met de Phoenix te verbeteren" },
