	["am_mp9_bioleak"] = { name = "Bioleak", desc = "Verschillende tinten groen creëren de illusie van een chemische lekkage.\n\nPAS OP VOOR DIRECTE BLOOTSTELLING" },
	["hy_p2000_oceani"] = { name = "Oceanic", desc = "Het heeft een zwarte basisverf gekregen en is daarna geaccentueerd met blauwe ontwerpen.\n\nHeeft iemand iets van Kotaro of Carmen gehoord? - Felix Riley, commandant" },
	["cu_p250_asiimov"] = { name = "Asiimov", desc = "Het is speciaal beschilderd met een sci-fi-ontwerp.\n\nAls je denkt dat ik een geweer nodig heb om een man te doden, heb je geen idee met wie je praat ... - Mikha Biton, Phoenix-sluipschutter" },
	["gs_sawedoff_fubar"] = { name = "Fubar", desc = "Er zijn op de loop van deze veel gebruikte shotgun vinkjes gekerft.\n\nHet begint met een knal... het eindigt met stilte" },
	["cu_sg553_atlas"] = { name = "Atlas", desc = "Het heeft een moderne camouflagehydroprint gekregen.\n\nHet was ooit een ontwerp dat was geoormerkt voor de Coalition Taskforce, maar Huxley hield zich bezig met bedrijfsspionage om het exclusief voor de Phoenix te maken" },
	["gs_ssg08_armacore"] = { name = "Ghost Crusader", desc = "Het is wit gespoten en heeft arctisch blauwe accenten gekregen.\n\nIk kan nooit dat vervangen dat van ons is gestolen... maar ik kan nog meer van hun afpakken - De feniks en de ingewijde, deel 2" },
	["am_tec9_redblast"] = { name = "Re-Entry", desc = "De loop heeft een vlammensticker gekregen.\n\nIk haat het om altijd gelijk te hebben - Carmen Cocinero, reddingsexpert" },
	["cu_ump45_primalsaber"] = { name = "Primal Saber", desc = "Het heeft een sticker van een sabeltandtijgerschedel gekregen.\n\nElk roofdier komt uiteindelijk aan zijn einde" },
	["cu_xm1014_spectrum"] = { name = "Black Tie", desc = "Deze shotgun, met zwart en wit chroom, is het beste voor formele gelegenheden.\n\nWe hebben Izaki en Cocinero. Heb je ze voor iets nodig of kan ik ze nu omleggen? - De huurling en de slang, deel 1" },
