	["bloodhound_guerrilla"] = { name = "Guerrilla", desc = "Het is gemaakt met een mix van bruin leer en synthetische leer met een camouflageprint.\n\nValeria heeft vergelding op ogen, daar is geen twijfel over mogelijk... - Sebastien Hennequet, sluipschutter" },
