	["handwrap_red_slaughter"] = { name = "Slaughter", desc = "Deze wikkels, die donkerrood zijn geverfd, maken het moeilijk om te zien waar de stof eindigt en de bloedvlekken beginnen.\n\nWie houdt er nu niet van om met z'n handen te werken?" },
	["handwrap_fabric_orange_camo"] = { name = "Badlands", desc = "Deze zelfgemaakte handbescherming is gemaakt met verzamelde materialen.\n\nFelix laat de illegale bokscompetitie van de Coalition Taskforce lekker hun gang gaan" },
