	["sp_tape_dots_bravo"] = { name = "sp_tape_dots_bravo", desc = "Dit aandenken van Gwalior is gespraypaint door slierten tape en geperforeerd metaal als stencils te gebruiken.\n\nGeen zorgen... de zaken staan op het punt om beter te gaan - Booth, wapenhandelaar" },
