	["so_jungle_bravo"] = { name = "so_jungle_bravo", desc = "Dit aandenken van Ruins heeft losse onderdelen die zijn gespraypaint in een effen, junglekleurenschema.\n\nVoor diegenen met een lust voor vernieling" },
