	["an_gunmetal_bravo"] = { name = "an_gunmetal_bravo", desc = "Dit aandenken van Siege is geverfd door over een chromen lakbasis brons geanodiseerde verf te gebruiken.\n\nJe kent Felix Riley niet als ik... die man is onmogelijk te breken - De verrader en de waardheidszoeker, deel 1" },
