	["snakeskin"] = { name = "snakeskin", desc = "Het is geverfd met een hydroprint van een slangenhuidpatroon.\n\nIk weet dat je niet in de missie gelooft... en als ik je verraad zal Valeria je hoofd willen - Het schild en de slang, deel 1" },
	["cu_usp-s_elegant"] = { name = "cu_usp-s_elegant", desc = "Het is kobaltblauw geschilderd en gestencild met het CT-logo op de zijkant.\n\nIk kan de procedure volgen en zeven mensen redden of ik doe het op mijn manier en ik red ze alle tien... jouw keuze - Carmen Cocinero, reddingsexpert" },
	["hy_plaid2"] = { name = "hy_plaid2", desc = "Het is beschilderd met een hydroprint van een taupe en blauw-groen geruit patroon.\n\nHet is geen doedelzak, maar het speelt wel een lied voor elke begrafenis" },
	["cu_fiveseven_urban_hazard"] = { name = "cu_fiveseven_urban_hazard", desc = "Het is speciaal beschilderd met stedelijke camouflage en rode accenten.\n\nElk jaar brengt Booth de vooraanstaande wapensmeden samen om hun nieuwste ontwerpen te tonen" },
	["an_emerald"] = { name = "an_emerald", desc = "Het is geverfd met een chroomkleurige grondlaag en afgelakt met transparante smaragdgroene verf met anodisatie-effect.\n\nIs dit wat er van de grote Sebastien Hennequet geworden is? Een zeurende schoolmeester? Wat is er met je gebeurd... - De leraar en de beeldenstormer, deel 2" },
	["so_keycolors"] = { name = "so_keycolors", desc = "Het heeft losse onderdelen die in effen kleuren met een blauw en oranje kleurenschema zijn gespoten.\n\nDe grote gelijkmaker" },
	["cu_awp_mastery"] = { name = "cu_awp_mastery", desc = "Het is speciaal beschilderd met een combinatie van hydroprints en zorgvuldig sjabloneren en door middel van warmteoverdracht voorzien van stickers.\n\nChase Turner was een groots man... je zult grote schoenen moeten vullen – De feniks en de ingewijde, deel 1" },
	["aq_dualberettas_cartel"] = { name = "aq_dualberettas_cartel", desc = "Het is gegraveerd met skeletten, bloemen en slangen.\n\nDaarom doet Huxley al het zware werk, we hoeven haar alleen een zetje te geven... - De slang en de waarheidszoeker, deel 2" },
	["aq_famas_contour"] = { name = "aq_famas_contour", desc = "Het is speciaal beschilderd met een modern rood en grijs ontwerp dat de vorm van het wapen completeert.\n\nSamen zijn we altijd sterker" },
	["cu_nova_hyperbeast"] = { name = "cu_nova_hyperbeast", desc = "Het is speciaal beschilderd met een beestachtig schepsel in psychedelische kleuren.\n\nZe noemen je de Oni, toch? Wat een enge naam voor zo'n droevige man... – Elliot Kingsman, huurling" },
